(16, 'Refund Policy', 'Refund Policy', '&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: medium;&quot;&gt;Please take time and evaluate the website using our online demo. Before purchase, make sure that your server supports the software requirements. Refunds will not be given for reasons surrounding the user&#039;s lack of knowledge of the script&#039;s functionality, limitations, or restrictions, as we provided every opportunity to evaluate the script prior to purchase. If you have a question, please ask our staff before making your purchase. Complete source code is shipped with the software , therefore all sales are final. Refund is only allowed if there is encrypted code to provided script from Narjis Enterprise&lt;/span&gt;&lt;/p&gt;', 'APPROVED'),
(7, 'Terms and Condition', 'Terms and Condition', '&lt;p style=&quot;margin: 0 10px;&quot; align=&quot;justify&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: small;&quot;&gt;This agreement sets out the terms and conditions applicable to customers of Narjis Enterprise Products. By ordering our Product you bind yourself to this agreement and certify that you do, in fact, agree to this agreement in full. A script license, issued to a designated user only by Narjis Enterprise, is required for each user of the Product. If you do not agree to the terms of this, then do not install or use the Script. By explicitly accepting these terms, however, or by installing, copying, downloading, accessing, or otherwise using the script, you are acknowledging and agreeing to be bound by the following terms:&lt;/span&gt;&lt;/p&gt;\r\n\n\n&lt;p&gt;&lt;span style=&quot;font-family: Verdana; font-size: small;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: small;&quot;&gt;&lt;br /&gt;&lt;br /&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\n\n&lt;p style=&quot;margin: 0 10px;&quot; align=&quot;justify&quot;&gt;&lt;strong&gt;Delivery Of Product&lt;/strong&gt;: If the payment is made during Monday to Friday between 10 AM to 6 PM IST, product will be delivered within 24 hours. If payment is made during weekends (Saturday &amp;amp; Sunday) or during any Indian National Holidays, the same will be delivered within 48 hours of payment.&lt;/p&gt;\r\n\n\n&lt;p&gt;&lt;span style=&quot;font-family: Verdana; font-size: small;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: small;&quot;&gt;&lt;br /&gt;&lt;br /&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\n\n&lt;p style=&quot;margin: 0 10px;&quot; align=&quot;justify&quot;&gt;&lt;strong&gt;License&lt;/strong&gt;: The script, which is issued to a designated user, enables such designated user to install and use the script on a multiple website/domain. You may modify or create derivative copies of the script.&lt;/p&gt;\r\n\n\n&lt;p style=&quot;margin: 0 10px;&quot; align=&quot;justify&quot;&gt;Liabilities: The company is not responsible for any damages including any general ,special , incidental damages arising out of the changes done to the code or arising out of the use or inability to use the program (including but not limited to loss of data or data being rendered inaccurate or losses sustained by you.)&lt;/p&gt;\r\n\n\n&lt;p&gt;&lt;span style=&quot;font-family: Verdana; font-size: small;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: small;&quot;&gt;&lt;br /&gt;&lt;br /&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\n\n&lt;p style=&quot;margin: 0 10px;&quot; align=&quot;justify&quot;&gt;&lt;strong&gt;Permit To Use&lt;/strong&gt;: We reserve the right to include the copyright notices text/link in the footer of all pages. The copyright notices text/link can be removed ONLY by purchasing script.&lt;/p&gt;', 'APPROVED'),
(8, 'About Us', 'About Us', '&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;Narjis Enterprise is the ultimate way out for reliable and personalized matchmaking online matrimonial services that we have created completely and for the peace of user&amp;rsquo;s mind. The possessor is able to find, update, add, delete, and modify their profiles from the database. The script is wholly revolutionized so the way Indian brides and bridegrooms get together for wedding ceremony.&lt;/span&gt;&lt;/p&gt;\r\n\n&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\n&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: medium;&quot;&gt; This one is the most salient preference if you&#039;re in search of a professional matrimonial website. We engaged ourselves to put maximum numbers of features by which you can access countless benefits. Hence, for yours seek to begin your online matrimonial website, Matrimonial Script php is the best alternative for you.&lt;/span&gt;&lt;/p&gt;\r\n\n&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\n&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: medium;&quot;&gt; The script will be accessible to you to run your own professional matrimony website within few hours. We suggest the scripts to you high quality PHP Matrimonial Script has been motivating webmasters to debut their new gainful online matrimony services. This is a very influential online matrimonial script that we have developed. User can add, remove and vary descriptions, upload images and photos.&lt;/span&gt;&lt;/p&gt;\r\n\n&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\n&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: medium;&quot;&gt; It is one of the most trendy services on the web is matrimonial profile posting and partner search websites. It has become essential that you provide these functionalities on your website. This is the only opportunity for you to deliver these services to the vast audience of match-seekers.&lt;/span&gt;&lt;/p&gt;\r\n\n&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: medium;&quot;&gt; The matrimonial arrangement application allows potential brides and bridegrooms to put their profiles and search partner profiles for a cost. You can exploit the numerous advantages by whatever delivered by our efforts for the work of its functions.&lt;/span&gt;&lt;/p&gt;', 'APPROVED'),
(9, 'Contact Us', 'Contact Us', '&lt;p&gt;Narjis Enterprise&lt;/p&gt;\r\n\n\n&lt;p&gt;Ahmedabad&lt;/p&gt;', 'APPROVED'),
(13, 'FAQ page', 'FAQ page', '&lt;p&gt;&lt;span style=&quot;font-family: Verdana; font-size: small;&quot;&gt;&lt;strong&gt;1. Which is the version in this script? &lt;/strong&gt; &lt;br /&gt; We have Cprporate Matrimonial Script in PHP Latest Version 1.1&lt;br /&gt; &lt;br /&gt; &lt;strong&gt;2. After making payment, when will I get the product? &lt;/strong&gt; &lt;br /&gt; Delivery of product is done within 24hrs of payment made from your end. Product is delivered to you through email only. &lt;br /&gt; &lt;br /&gt; &lt;strong&gt;3. Can you customize the script? &lt;/strong&gt; &lt;br /&gt; Yes, The Script can be customize. Design can be modified. &lt;br /&gt; &lt;br /&gt; &lt;strong&gt;4. Do you offer the Source CODE ? &lt;/strong&gt; &lt;br /&gt; The script is with source code. The User/developer can modify the DESIGN part, provided they have good html expertise. &lt;br /&gt; &lt;br /&gt; &lt;strong&gt;5. I don&#039;t know How to Install the product, will there be any installation service or support from your end? &lt;/strong&gt; &lt;br /&gt; We provide free installation service @ zero cost, if you want. All you&#039;ve to do is provide us with your domain name, FTP, database server name, database name, username &amp;amp; Password. Installation is done in 24hrs on request. &lt;br /&gt; &lt;br /&gt; &lt;strong&gt;6. Is the product customizable, if yes any charges? &lt;/strong&gt; &lt;br /&gt; Yes, the product is completely customizable. However on purchase you get the default design. Using Admin Panel you can change the logos, Banners, color combinations, Icons &amp;amp; much more. If you want to give a complete new look to your site, which require alteration &amp;amp; updation of all the pages, there will be additional customization charges. Charges may vary depending on your customization requirement. For minor customization we won&#039;t charge you anything. &lt;br /&gt; &lt;br /&gt; &lt;strong&gt;7. What&#039;s the security / Guarantee of product delivery after payment? &lt;/strong&gt; &lt;br /&gt; Narjis Enterprise is well established with more than 50+ Programmers &amp;amp; Designers employed in India. Apart from this we have more than 250+ Freelance Designers &amp;amp; Programmers world wide. We have many clients from UK, US, European Nations, India, Pakistan &amp;amp; other countries. Hence we can assure you &amp;amp; give you 100% Guarantee of product delivery in time. All our products are completely Ready2Go Scripts, until &amp;amp; Unless customization is required at your end. Delivery are made in 24hrs. &lt;/span&gt;&lt;/p&gt;', 'APPROVED'),
(11, 'Wedding Planner', 'Hello Everyone', 'Hello Everyone', 'APPROVED'),
(15, 'Report Misuse', 'Report Misuse', '&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: large; color: #ff0000;&quot;&gt;Please Contact to Admin if you find any misuses...&lt;br /&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;', 'APPROVED'),
