damages arising out of the changes done to the code or arising out of the use or inability to use the program (including but not limited to loss of data or data being rendered inaccurate or losses sustained by you.)&lt;/p&gt;\r\n\n\n&lt;p&gt;&lt;span style=&quot;font-family: Verdana; font-size: small;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: small;&quot;&gt;&lt;br /&gt;&lt;br /&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\n\n&lt;p style=&quot;margin: 0 10px;&quot; align=&quot;justify&quot;&gt;&lt;strong&gt;JURISDICTION&lt;/strong&gt;: This website is maintained by Narjis Enterprise Ahmedabad, India. Ahmedabad shall be the legal venue for all disputes arising from or in connection with this website.&lt;/p&gt;', 'APPROVED');
