(1, 'Registration', 'REGISTRATION', 'Confirm your email', '&lt;table style=&quot;margin: auto; border: 5px solid #43609c; font-family: Arial,Helvetica,sans-serif; font-size: 12px; padding: 0px; width: 710px;&quot; border=&quot;0&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td style=&quot;float: left; min-height: auto; border-bottom: 5px solid #43609c;&quot;&gt;\r\n&lt;table style=&quot;margin: 0px; padding: 0px; width: 710px;&quot; border=&quot;0&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr style=&quot;background: #f9f9f9;&quot;&gt;\r\n&lt;td style=&quot;float: right; font-size: 13px; padding: 10px 15px 0 0; color: #494949;&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n&lt;td style=&quot;float: left; margin-top: 5px; color: #048c2e; font-size: 26px; padding-left: 15px;&quot;&gt;your site name&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td style=&quot;float: left; width: 710px; min-height: auto;&quot;&gt;\r\n&lt;h6 style=&quot;float: left; clear: both; width: 680px; font-size: 13px; margin: 10px 0 0 15px;&quot;&gt;Hello,&lt;/h6&gt;\r\n&lt;p style=&quot;float: left; clear: both; width: 680px; font-size: 13px; margin: 10px 0 0 15px; color: #494949;&quot;&gt;You have registered to our your site name ,Below is the login detail please confirm your email-id by clicking the following link...&lt;/p&gt;\r\n&lt;p style=&quot;float: left; clear: both; width: 680px; font-size: 13px; margin: 10px 0 0 15px; color: #494949;&quot;&gt;&lt;strong style=&quot;float: left; margin: 5px 0 5px 30px; padding: 5px 20px; background: #f3f3f3; font-size: 13px; color: #096b53;&quot;&gt; Dear, name&lt;br /&gt; Matri-id : matriid &lt;br /&gt; Email-ID : email_id&lt;br /&gt; Confirmation Link : &lt;a href=&quot;site domain name?confirm_id=cpass&amp;amp;email=email_id&quot; target=&quot;_blank&quot;&gt;site domain name?confirm_id=cpass&amp;amp;email=email_id&lt;/a&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;float: left; clear: both; width: 680px; font-size: 13px; margin: 10px 0 0 15px; color: #494949;&quot;&gt;Thank you for helping us reach you better,&lt;/p&gt;\r\n&lt;p style=&quot;float: left; clear: both; width: 680px; font-size: 13px; margin: 10px 0 5px 15px; color: #494949;&quot;&gt;Thanks &amp;amp; Regards ,&lt;br /&gt;Team your site name&lt;/p&gt;\r\n&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;', 'APPROVED'),
(2, 'Delete Member', 'MEMBER_ACTION', 'Your request for deleting profile is being processed', '&lt;table style=&quot;margin: auto; border: 5px solid #43609c; font-family: Arial,Helvetica,sans-serif; font-size: 12px; padding: 0px; width: 710px;&quot; border=&quot;0&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td style=&quot;float: left; min-height: auto; border-bottom: 5px solid #43609c;&quot;&gt;\r\n&lt;table style=&quot;margin: 0px; padding: 0px; width: 710px;&quot; border=&quot;0&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr style=&quot;background: #f9f9f9;&quot;&gt;\r\n&lt;td style=&quot;float: left; margin-top: 5px; color: #048c2e; font-size: 26px; padding-left: 15px;&quot;&gt;webfriendlyname&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td style=&quot;float: left; width: 710px; min-height: auto;&quot;&gt;\r\n&lt;h6 style=&quot;float: left; clear: both; width: 500px; font-size: 13px; margin: 10px 0 0 15px;&quot;&gt;Hello, Dear&lt;/h6&gt;\r\n&lt;p style=&quot;float: left; clear: both; width: 500px; font-size: 13px; margin: 10px 0 0 15px; color: #494949;&quot;&gt;We have accepted your request and Your profile will be Deleted.&lt;/p&gt;\r\n&lt;p style=&quot;float: left; clear: both; width: 500px; font-size: 13px; margin: 10px 0 0 15px; color: #494949;&quot;&gt;Thank you for staying with us,&lt;/p&gt;\r\n&lt;p style=&quot;float: left; clear: both; width: 500px; font-size: 13px; margin: 10px 0 5px 15px; color: #494949;&quot;&gt;Thanks &amp;amp; Regards ,&lt;br /&gt;Team webfriendlyname&lt;/p&gt;\r\n&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;', 'APPROVED'),
(5, 'Paid Member', 'MEMBER_ACTION', 'Your Paid Membership has been activated.', '&lt;table style=&quot;margin: auto; border: 5px solid #43609c; font-family: Arial,Helvetica,sans-serif; font-size: 12px; padding: 0px; width: 710px;&quot; border=&quot;0&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td style=&quot;float: left; min-height: auto; border-bottom: 5px solid #43609c;&quot;&gt;\r\n&lt;table style=&quot;margin: 0px; padding: 0px; width: 710px;&quot; border=&quot;0&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr style=&quot;background: #f9f9f9;&quot;&gt;\r\n&lt;td style=&quot;float: left; margin-top: 5px; color: #048c2e; font-size: 26px; padding-left: 15px;&quot;&gt;webfriendlyname&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td style=&quot;float: left; width: 710px; min-height: auto;&quot;&gt;\r\n&lt;h6 style=&quot;text-align: justify; clear: both; width: 680px; font-size: 13px; margin: 10px 0 0 15px;&quot;&gt;Hello, name&lt;/h6&gt;\r\n&lt;p style=&quot;text-align: justify; clear: both; width: 680px; font-size: 13px; margin: 10px 0 0 15px; color: #494949;&quot;&gt;Congratulations! Your Paid Membership on $webfriendlyname has been activated. You are now ready to search and contact millions of validated profiles.&lt;/p&gt;\r\n&lt;p style=&quot;float: left; clear: both; width: 680px; font-size: 13px; margin: 10px 0 0 15px; color: #494949;&quot;&gt;Log on to&amp;nbsp;webfriendlyname now using the follwing information to find your dream partner.&lt;/p&gt;\r\n&lt;p style=&quot;float: left; clear: both; width: 680px; font-size: 13px; margin: 10px 0 0 15px; color: #494949;&quot;&gt;&lt;strong style=&quot;float: left; margin: 5px 0 5px 30px; padding: 5px 20px; background: #f3f3f3; font-size: 13px; color: #096b53;&quot;&gt; Login ID : matriid (or) email_id&lt;br /&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify; clear: both; width: 680px; font-size: 13px; margin: 10px 0 0 15px; color: #494949;&quot;&gt;And while you are on the site we strongly encourage you to use as many features. This way you will understand how easy it is to use our site and more importantly find your life partner. Some of the key features that you could straight away start using are:&lt;br /&gt;&lt;br /&gt; &lt;strong&gt;Upload Photo&lt;/strong&gt;: 90% of members look for profiles with photos. Don&#039;t miss out on this chance. Add your photo now and increase your responses by 10 times.&lt;br /&gt;&lt;br /&gt; &lt;strong&gt;Assured Contact&lt;/strong&gt;: Get your phone number validated for FREE and get a direct connection to your life partner.&lt;br /&gt;&lt;br /&gt; &lt;strong&gt;Add video&lt;/strong&gt;: Add video clipping to your profile for FREE and increase your responses.&lt;br /&gt;&lt;br /&gt; Everybody here at Narjis Enterprise, wish you all the very best in your search for a life partner. Should you require any further assistance, do not hesitate to call our office OR visit our 24/7 live support.&lt;br /&gt;&lt;br /&gt; Good luck in your search for a life partner.&lt;br /&gt;&lt;br /&gt;&lt;/p&gt;\r\n&lt;p style=&quot;float: left; clear: both; width: 680px; font-size: 13px; margin: 10px 0 5px 15px; color: #494949;&quot;&gt;Thank you for helping us reach you better,&lt;/p&gt;\r\n&lt;p style=&quot;float: left; clear: both; width: 680px; font-size: 13px; margin: 10px 0 5px 15px; color: #494949;&quot;&gt;Thanks &amp;amp; Regards ,&lt;br /&gt;Customer Support Manager. &lt;br /&gt; Team webfriendlyname&lt;/p&gt;\r\n&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;', 'APPROVED'),
(6, 'Featured Profile', 'MEMBER_ACTION', 'Your profile is selected as Featured Profile now.', '&lt;table style=&quot;margin: auto; border: 5px solid #43609c; font-family: Arial,Helvetica,sans-serif; font-size: 12px; padding: 0px; width: 710px;&quot; border=&quot;0&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td style=&quot;float: left; min-height: auto; border-bottom: 5px solid #43609c;&quot;&gt;\r\n&lt;table style=&quot;margin: 0px; padding: 0px; width: 710px;&quot; border=&quot;0&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr style=&quot;background: #f9f9f9;&quot;&gt;\r\n&lt;td style=&quot;float: left; margin-top: 5px; color: #048c2e; font-size: 26px; padding-left: 15px;&quot;&gt;webfriendlyname&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td style=&quot;float: left; width: 710px; min-height: auto;&quot;&gt;\r\n&lt;h6 style=&quot;float: left; clear: both; width: 500px; font-size: 13px; margin: 10px 0 0 15px;&quot;&gt;Hello, Dear&lt;/h6&gt;\r\n&lt;p style=&quot;float: left; clear: both; width: 500px; font-size: 13px; margin: 10px 0 0 15px; color: #494949;&quot;&gt;Your profile is selected as &#039;Featured Profile&#039; now. Log on to &lt;a href=&quot;website&quot;&gt;webfriendlyname&lt;/a&gt; now.&lt;/p&gt;\r\n&lt;p style=&quot;float: left; clear: both; width: 500px; font-size: 13px; margin: 10px 0 0 15px; color: #494949;&quot;&gt;Thank you for helping us reach you better,&lt;/p&gt;\r\n&lt;p style=&quot;float: left; clear: both; width: 500px; font-size: 13px; margin: 10px 0 5px 15px; color: #494949;&quot;&gt;Thanks &amp;amp; Regards ,&lt;br /&gt;Team webfriendlyname&lt;/p&gt;\r\n&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;', 'APPROVED'),
